import styled from 'styled-components';

export const Generation2 = () => {
  return (
    <GenStyle>
        <div><h1>Generation2</h1></div>
    </GenStyle>
  )
}
const GenStyle = styled.div`

div{
    display: flex;
    flex-direction: column;
    align-items: center;
    padding-top: 6rem;
    
}

`;
